import React from "react";
import {
  FormItemGender,
  FormItemFullName,
  FormItemPhone,
  FormItemMail,
} from "../../Shared/Input";
import { ButtonSave } from "../../Shared/Button";
import { Form } from "antd";

export const AddForm = ({ loading, onFinish }) => (
  <Form onFinish={onFinish}>
    <FormItemGender />
    <FormItemFullName />
    <FormItemPhone />
    <FormItemMail />
    <ButtonSave type="primary" htmlType="submit" loading={loading} />
  </Form>
);

export const ContactForm = ({ onFinish }) => {
  return (
    <Form onFinish={onFinish}>
      <FormItemGender />
      <FormItemFullName />
      <FormItemPhone />
      <FormItemMail />
      <ButtonSave type="primary" htmlType="submit" />
    </Form>
  );
};
